import GroupsIcon from '@mui/icons-material/Groups';

export const ChooseUs_Card_Detail = [
    {   
        icon:<GroupsIcon style={{color:"black", fontSize:"4.3rem" ,marginTop:".5rem"}}/>,
        title:"Well Balanced Team",
        para:"With a deep understanding and experience of the latest technologies, we have delivered over 50 successful projects.",
    },
    {
        icon:<i class="fa-solid fa-people-group" style={{color:"black", fontSize:"4.3rem", marginTop:".5rem"}}></i> ,
        title:"Strong Expertise",
        para:"With our core field of expertise being Android, Blockchain, iOS, React, etc. our development experts remain on the cutting edge of the newest and most successful technology trends and popular applications on the market.",
    },
    {
        icon:<i class="fa-solid fa-person-rays" style={{color:"black", fontSize:"4.3rem", marginTop:".5rem"}}></i>,
        title:"Customer Centric Approach",
        para:"We ensure that the customer Idea is at the center of a business's philosophy. We always work on end-user experience.",
    },
    {
        icon:<i class="fa-solid fa-gears" style={{color:"black", fontSize:"4.3rem",marginTop:".5rem"}}></i>,
        title:"Advanced Technology",
        para:"Our in-house IT and development team allows us to provide advance technology-enabled solutions that can make processes more efficient and effective.",
    },
    {
        icon:<i class="fa-solid fa-hand-holding-dollar" style={{color:"black", fontSize:"4.3rem",marginTop:".5rem"}}></i>,
        title:"Low Investment Cost",
        para:"Low cost doesn’t necessarily mean poor quality or poor service. By diving into our professional workforce expert, Direct Sourcing Solutions can provide world-class services at the most competitive prices.",
    },
    {
        icon:<i class="fa-solid fa-person-dress-burst" style={{color:"black", fontSize:"4.3rem", marginTop:".5rem"}}></i>,
        title:"Domain Expertise",
        para:"With multiple projects done on Travel, Healthcare, Ecommerce, Education, and more. We know the trends well and having years of expertise in different business domains.",
    },
]
